-- ----------------------------
-- Table structure for user_pay_order_0
-- ----------------------------
DROP TABLE IF EXISTS `user_pay_order_0`;
CREATE TABLE `user_pay_order_0`  (
  `id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'id',
  `merchant_id` bigint(20) NOT NULL COMMENT '商家Id',
  `user_pay_id` bigint(20) NOT NULL COMMENT '支付用户id',
  `amount_of_consumption` decimal(10, 2) NOT NULL COMMENT '消费金额',
  `pay_able_amount` decimal(10, 2) NOT NULL COMMENT '实际支付的金额',
  `merchant_receive_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '商家实际可收金额',
  `pay_type` tinyint(4) NULL DEFAULT NULL COMMENT '支付类型(0微信、1支付宝、汇潮)',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '支付成功时间',
  `user_id` bigint(20) NULL DEFAULT NULL COMMENT '主账户id',
  `discount_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '抵扣卷金额',
  `free_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '免单卷金额',
  `status` tinyint(4) NULL DEFAULT NULL COMMENT '1:成功;2:用户取消;3:失败;4:待支付',
  `channel_id` tinyint(4) NULL DEFAULT NULL COMMENT '渠道 1:微信、2支付宝、3:菜信',
  `enjoy_king_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '享利金金额',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `enjoy_issue_king_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '发放享利金金额',
  `enjoy_receive_king_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '用户实收享利金金额',
  `scan_type` tinyint(4) NULL DEFAULT NULL COMMENT '扫码方式(0：客户被扫、1：客户主扫)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'c_main_orde_user(用户订单表)' ROW_FORMAT = Dynamic;

